import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="home-container">
      <div className="home-content">
        {/* Headline */}
        <h1>Trusted Medical Care, Always by Your Side</h1>

        {/* Subheadline */}
        <p className="subheadline">
          Expert healthcare solutions tailored to your needs. Your health and well-being are our top priorities.
        </p>

        {/* Key Highlights */}
        <div className="home-highlights">
          <div className="highlight">
            <h2>Specialized Care</h2>
            <p>Our team of experienced professionals provides comprehensive treatment for a wide range of health concerns.</p>
          </div>
          <div className="highlight">
            <h2>Advanced Diagnostics</h2>
            <p>Equipped with state-of-the-art technology for precise and quick medical analysis.</p>
          </div>
          <div className="highlight">
            <h2>Seamless Access</h2>
            <p>Book appointments, consult online, or visit in person â€” healthcare made easy.</p>
          </div>
        </div>

        {/* Call-to-Action */}
        <div className="cta">
          <button className="cta-button">Book an Appointment</button>
          <button className="cta-button">Learn More</button>
        </div>
      </div>

      {/* Overlapping Image */}
      <div className="home-image">
        <img src="/path-to-your-image.jpg" alt="Healthcare professionals" />
      </div>
    </div>
  );
}

export default Home;
